import React from "react";
import { about } from "../data";

export default function Profile() {
  return (
    <>
      <section id="profile" className="profile">
        <h2 className="section-title">Profile</h2>
        {about.map((text) => (
          <p>{text.text}</p>
        ))}
      </section>
    </>
  );
}
